var imgObj = document.createElement("img");
imgObj.src = "data:image/gif;base64,";
var divObj = document.getElementById("M00-loading");
divObj.appendChild(imgObj); 
function addGlobalStyle(css) {
  var head, style;
  head = document.getElementsByTagName('head')[0];
  if (!head) { return }
  style = document.createElement('style');
  style.type = 'text/css';
  style.innerHTML = css;
  head.appendChild(style);
}
addGlobalStyle('img[src="images/myd_loading.gif"]{display: none !important;}'); 